import React from "react";
import { useHistory } from "react-router";

const Contact = (props) => {
    history = useHistory()

  return (
    <>
      <h1>Hello, I am {props.name} Page</h1>

      <button onClick={() => history.forward()}>Go Forward</button>
    </>
  );
};

export default Contact;
